import React from 'react';
import { useNavigate } from 'react-router-dom'; 
import './LoginPage.css';
import logo from './assets/logo.png';

const LoginPage = () => {
  const navigate = useNavigate(); 

  return (
    <div className="login-page">
      <div className="login-container">
        <h2 className="welcome-text">Welcome Back!</h2>
        <img
          src={logo}
          alt="Bannari Amman Institute of Technology"
          className="login-logo"
        />
        <hr className="divider" />
        <button onClick={() => login('admin')} className="google-sign-in">Admin Sign In</button><br />
        <button onClick={() => login('faculty')} className="google-sign-in">Faculty Sign In</button>
        <p className="sign-in-text">Sign in with your BIT account</p>
      </div>
    </div>
  );
};

export default LoginPage;
